INSERT INTO `channels` VALUES (248, 0, 'UCcUB8t47AAu5WKmaUSdaN_g', 'Jucker Farm', 'Obstbau zum Erlebnis machen. Das ist unser Ding. Angefangen hat alles vor 20 Jahren mit der verr√ºckten Idee einer K√ºrbisausstellung nachdem die Br√ºder Martin und Beat Jucker den elterlichen Hof √ºbernommen haben. Heute haben besteht die Jucker Farm AG aus 4 H√∂fen:<br /><br />Juckerhof in Seegr√§ben: Erlebnishof mit Restaurant, eigener B√§ckerei, Hofladen, √ñpfelGarte, Heidelbeeren und Kirschen Selberpfl√ºcken, Geisslipark und beste Lage am Pf√§ffikersee. Hier werden noch immer √Ñpfel und Birnen sowie einige Beeren und Wein produziert.<br /><br />B√§chlihof in Jona: Erlebnishof mit Hofladenrestaurant, Heidelbeeren zum Selberpfl√ºcken, Geissli und H√§sli, ideal gelegen in mitten von Obstb√§umen direkt am Obersee. Hier wachsen √Ñpfel, Birnen, Heidelbeeren und sogar ein paar Kiwis. Ausserdem befindet sich hier die Hofmanufaktur.<br /><br />Spargelhof in Rafz: Hier wachsen Spargeln, K√ºrbis und Co. Inkl. grossem Hofladen.<br /><br />R√∂merhof in Kloten: Hofladen und Blumen zum Selberpfl√ºcken.<br /><br />Wir freuen uns auf Ihren Besuch!', 'https://yt3.ggpht.com/a/AATXAJyFr2YT9BQHDatYKmDYDeXZ6pAMe0eK6l4-G-eI7A=s88-c-k-c0xffffffff-no-rj-mo', 'Beat & Martin Jucker', 'https://www.youtube.com/juckerfarmag', 'https://www.juckerfarm.ch', '', '', 'jucker_farm', '-13-18-20-', '27.09.2009', '201017-11', '201017-11', 0, 0, 0, 246, 342, 427, NULL, 0, 0, 0, 220700, 273276, 315595, NULL, 205, NULL, '#FarmTalk N¬∞17: Spezialfall Juckerhof', 'pnCT5Xxfj1I', '<td class=\"yt-lastvideo\" data-sort=\"201002092508\" data-utime=\"201017-11\"><a href=\"https://youtu.be/pnCT5Xxfj1I\" title=\"#FarmTalk N¬∞17: Spezialfall Juckerhof\" target=\"_blank\">Fr. 02.10.20</a><div class=\"info\"><div class=\"close\"></div><div class=\"circle\" style=\"background-image:url(https://i1.ytimg.com/vi/pnCT5Xxfj1I/hqdefault.jpg)\"></div><p>#FarmTalk N¬∞17: Spezialfall Juckerhof<br><br>Views: 113 &nbsp; √ò/Video: 1539<br>Ver√∂ff