INSERT INTO `channels` VALUES (276, 0, 'UCrsd_S0gN5IHtAPdeVR_ivg', 'Florian Summer', 'Mit seinem Debut Album ‚ÄûPoolboy‚Äú hat Florian Summer 2018 einen regelrechten Senkrechtstart hingelegt  und ist direkt auf Platz 11 der Schweizer-Album-Charts eingestiegen. Mit ‚ÄûRimini‚Äú  und \"Machu Picchu\" sind ihm zwei kleine Radiohits gelungen und der Festivalsommer 2018 mit √ºber 20 Konzerten war Rock&Roll pur. Medien schreiben √ºber ihn: \"He did the best show of all bands at the (Rock am Weiher) Festival\".Florian Summers Texte spielen mit Klischees, die er augenzwinkernd betrachtet und besitzen einen einzigartigen Charme, dem man sich nur schwer entziehen kann. Musikalisch verleiht der freche Newcomer dem Mundartpop ein erfrischendes Elektropop-Gewand und erschafft so seine ganz eigene Klangwelt. 2020 steht im Zeichen einer neuen Platte - TOYBOY!<br /><br />With his debut album ‚ÄúPoolboy‚Äù, Florian Summer mad an impressive start and entered the Swiss album charts at number 11. His second album \"Toyboy\" will come out this summer.', 'https://yt3.ggpht.com/a/AATXAJzx_3U9YZZg5EWzPZrpBUNv9bHc6P0VGXypsJxvDQ=s88-c-k-c0xffffffff-no-rj-mo', '', '', 'http://www.floriansummer.ch', '', '', 'florian_summer_music', '-8-20-', '04.03.2017', '201017-11', '201017-11', 0, 0, 0, 0, 0, 776, NULL, 0, 0, 0, 0, 0, 1521234, NULL, 31, NULL, 'Florian Summer - 500\'000 (4 twins edition)', 'vj78K94m09o', '<td class=\"yt-lastvideo\" data-sort=\"201004120010\" data-utime=\"201017-11\"><a href=\"https://youtu.be/vj78K94m09o\" title=\"Florian Summer - 500\'000 (4 twins edition)\" target=\"_blank\">So. 04.10.20</a><div class=\"info\"><div class=\"close\"></div><div class=\"circle\" style=\"background-image:url(https://i3.ytimg.com/vi/vj78K94m09o/hqdefault.jpg)\"></div><p>Florian Summer - 500\'000 (4 twins edition)<br><br>Views: 7907 &nbsp; √ò/Video: 49072<br>Ver√∂ffentlicht am: So. 04.10.20 um 12:00 Uhr</p><div class=\"abobar\"><a href=\"https://youtu.be/vj78K94m09o\" target=\"_blank\" class=\"red