INSERT INTO `channels` VALUES (476, 0, 'UCLAkQSEz6wXbqgg6WtC1t9g', 'Learn Swiss German', 'My name is Kathrin. I am a Swiss-German teacher from Switzerland. I specialize in teaching conversational Swiss German. I am also fluent in German and French. The main focus of my lessons is on speaking. I am very flexible and always try to adjust to students needs and levels. The lessons can take place online via Skype or FaceTime or other messengers. During our conversation lessons, I make notes on our online document. If the students require I also make audio recordings from our notes.  <br /><br />I was brought up in Fribourg and went to school in Bern. My mother is from Zurich and father from Luzern. I am familiar with many dialects. <br /><br />If you are interested in improving your Swiss German feel free to contact me to arrange your first lesson with me.', 'https://yt3.ggpht.com/a/AATXAJwxg5DuJyNt9MdPfIWz7xHdzsC_iwSB8I6Bg2qzvQ=s88-c-k-c0xffffffff-no-rj-mo', 'Kathrin', 'https://www.youtube.com/learnswissgerman', 'https://www.swiss-german-online.com', '', '', 'swiss_german_online', '-16-18-', '13.05.2008', '201017-11', '201017-11', 0, 3965, 5336, 7454, 10100, 14200, NULL, 0, 2460134, 2759064, 1607569, 644770, 902979, NULL, 422, NULL, 'Birthdays, parties, gifts in Switzerland || Swiss German Online Language School', 'rfUFzNDTMP0', '<td class=\"yt-lastvideo\" data-sort=\"201016121319\" data-utime=\"201017-11\"><a href=\"https://youtu.be/rfUFzNDTMP0\" title=\"Birthdays, parties, gifts in Switzerland || Swiss German Online Language School\" target=\"_blank\">Fr. 16.10.20</a><div class=\"info\"><div class=\"close\"></div><div class=\"circle\" style=\"background-image:url(https://i3.ytimg.com/vi/rfUFzNDTMP0/hqdefault.jpg)\"></div><p>Birthdays, parties, gifts in Switzerland || Swiss German Online Language School<br><br>Views: 0 &nbsp; √ò/Video: 2140<br>Ver√∂ffentlicht am: Fr. 16.10.20 um 12:13 Uhr</p><div class=\"abobar\"><a href=\"https://youtu.be/rfUFzNDTMP0\" target=\"_blank