INSERT INTO `channels` VALUES (477, 0, 'UC7gRJAzQ6zlpP0Kr7rfjJsw', 'Matteo', 'Matteo wusste bereits im Kindesalter, dass die Musik seine Leidenschaft ist. Damals noch heimlich im Zimmer, sp√§ter dann in der Schule am Xylophon, um dann schlussendlich zur Gitarre zu greifen.<br /><br />Im Juni 2015 fiel der offizielle Startschuss f√ºr den damals 16-J√§hrigen: Als Singer-Songwriter pr√§sentierte er seine eigenen Songs erstmals der √ñffentlichkeit. Sp√§ter kamen einige Instrumente mehr hinzu und die Band ‚ÄûKind of a Mate‚Äú war geboren.<br /><br />Nach zwei ver√∂ffentlichten EPs und mehr als 100 gespielten Konzerten in der ganzen Schweiz geht Matteo dieses Jahr nun neue Wege: 2020 m√∂chte er dem Experimentieren mehr Beachtung schenken. F√ºr mehr Spontanit√§t und weniger Verkopftheit und Planung ‚Äì √ºber Genre- und Sprachgrenzen hinausdenkend. Mit seinem Solo-Projekt wagt er den Schritt zur ehrlichen Mundart-Musik, irgendwo zwischen Pop und Hip-Hop.<br /><br />Das Songbird Festival Davos, das Stars in Town in Schaffhausen oder auch das Konzerthaus Sch√º√ºr in Luzern setzten bereits auf den Musiker dem Kanton Uri', 'https://yt3.ggpht.com/a/AATXAJwftDaw99Wg1IAmeONovQr34xHIZlV1CMlYyu3qcA=s88-c-k-c0xffffffff-no-rj-mo', 'Matteo Gisler', '', 'https://matthewcorvin.com', 'https://anchor.fm/chuchichaestli', '', 'eifachnurmatteo', '-8-12-32-', '28.06.2016', '201017-11', '201017-11', 0, 8, 8, 31, 42, 57, NULL, 0, 149, 191, 493, 68, 1526, NULL, 3, NULL, 'Nowhereland ‚Äì Matteo (Live Piano Version)', 'Mo8c79hDIrc', '<td class=\"yt-lastvideo\" data-sort=\"200622180008\" data-utime=\"201017-11\"><a href=\"https://youtu.be/Mo8c79hDIrc\" title=\"Nowhereland ‚Äì Matteo (Live Piano Version)\" target=\"_blank\">Mo. 22.06.20</a><div class=\"info\"><div class=\"close\"></div><div class=\"circle\" style=\"background-image:url(https://i2.ytimg.com/vi/Mo8c79hDIrc/hqdefault.jpg)\"></div><p>Nowhereland ‚Äì Matteo (Live Piano Version)<br><br>Views: 233 &nbsp; √ò/Video: 509<br>Ver√∂ffentlicht am: